abilizo de mis afirmaciones y puntos de vista al utilizar términos personales como “yo pienso”, en vez de términos impersonales como “se piensa”.',26),(91,18,'Cuando  hablo  sobre  el  problema  de  otra  persona,  suelo  responder  con  una  contestación que indica comprensión y no consejo.',26),(92,19,'Cuando formulo preguntas a otros para entender mejor sus puntos de vista, suelo preguntar ¿qué…? en vez de ¿por qué…?',26),(93,20,'Sostengo reuniones privadas habituales con las personas que viven y trabajan conmigo.',26),(95,1,'A menudo reafirmo mis prioridades para que las cosas menos importantes no me distraigan de las cosas más importantes.',27),(97,2,'Aliento a los demás a generar soluciones recomendadas, no sólo preguntas, cuando vienen a mí con problemas o conflictos. ',27),(96,3,'Me valgo de otros de manera eficaz para cumplir con las tareas laborales.',27),(94,4,'Utilizo eficazmente métodos de administración del tiempo como tener conciencia de mi tiempo, hacer listas de asuntos pendientes y priorizar tareas.',27),(98,5,'Sigo un programa de ejercicio regular para conservarme en forma.',28),(99,6,'Mantengo una relación abierta y de confianza con alguien con quien puedo compartir mis frustraciones.',28),(100,7,'Mantengo un equilibrio en mi vida al tener diversos intereses fuera de mi trabajo.',28),(101,8,'Tengo una relación cercana con alguien que funge como mi mentor o consejero.',28),(102,9,'Necesito y practico varias técnicas de relajación temporal, como respiración profunda y relajación muscular',29),(103,10,'Lucho por redefinir los problemas como oportunidades para mejorar.',29),(104,1,'Expreso de manera clara y explícita cuál es el problema. Evito tratar de resolverlo antes de haberlo definido.',30),(105,2,'Siempre genero más de una solución alternativa al problema, en vez de identificar sólo una solución evidente.',30),(106,3,'Tengo en mente las consecuencias a largo y a corto plazos cuando evalúo diversas alternativas de soluciones.',30),(107,4,'Reúno 