ignaciones laborales normales.',32),(120,17,'Me aseguro de que haya puntos de vista divergentes representados o expresados en cada situación compleja de solución de problemas.',32),(121,18,'Hago unas cuantas sugerencias inusitadas para estimular a las personas a encontrar nuevas formas de resolver los problemas.',32),(122,19,'Trato de adquirir información de individuos externos al grupo de solución de problemas, que se verán afectados por la decisión, para determinar sus preferencias y expectativas.',32),(123,20,'En ocasiones exhorto a individuos externos (por ejemplo, clientes o expertos reconocidos) a participar en las discusiones de solución de problemas.',32),(124,21,'Trato de dar reconocimiento no sólo a aquellos que llegan con ideas creativas (los campeones de las ideas), sino también a aquellos que apoyan las ideas de los demás (alentadores) y a quienes brindan los recursos para llevarlas a cabo (orquestadores).',32),(125,22,'Trato de dar reconocimiento no sólo a aquellos que llegan con ideas creativas (los campeones de las ideas), sino también a aquellos que apoyan las ideas de los demás (alentadores) y a quienes brindan los recursos para llevarlas a cabo (orquestadores).',32),(126,1,'Me esfuerzo por llegar a ser muy competente en mi campo de trabajo',33),(127,2,'Demuestro amabilidad, honestidad y sinceridad hacia las personas con quienes trabajo.\r\n',34),(128,3,'Hago un mayor esfuerzo y tomo más iniciativa de lo que se espera en mi trabajo.',35),(129,4,'Apoyo los eventos y las actividades sociales de la empresa.',36),(130,5,'Formo una amplia red de relaciones con personas de toda la empresa, en todos los niveles.',37),(131,6,'Envío mensajes personales a otros cuando logran algo importante o cuando comunico información relevante',38),(132,7,'En mi trabajo me esfuerzo por generar nuevas ideas, iniciar nuevas actividades y reducir el número de labores rutinarias',39),(133,8,'Trato de encontrar formas para llegar a ser un representante externo de mi unidad u organización.',40),(134,9,'Continuamente actualizo mis habilidades y conocimientos.',33),(135,10,'Me esfuerzo por mejorar mi apariencia personal.',34),(136,11,'Trabajo más arduamente que la mayoría de mis compañeros.',35),(137,12,'Aliento a los nuevos miembros para que respalden los valores organizacionales importantes, tanto con sus acciones como con sus palabras.',36),(138,13,'Obtengo acceso a información importante al convertirme en parte central de las redes de comunicación.',37),(139,14,'Me esfuerzo por encontrar oportunidades para hacer informes sobre mi trabajo, sobre todo a las personas de nivel jerárquico superior.',38),(140,15,'Realizo una variedad de actividades.',39),(141,16,'Mantengo mi trabajo relacionado con la misión central de la empresa.',40),(142,17,'Hago hincapié en la razón y la información de los hechos',41),(143,18,'Me siento cómodo empleando una variedad de técnicas de influencia, adaptándolas a las circunstancias específicas.',41),(144,19,'Otorgo recompensas a quienes están de acuerdo conmigo, estableciendo de esta forma una condición de reciprocidad.',41),(145,20,'Empleo un enfoque directo (propio) y claro en vez de uno indirecto y manipulador.',41),(146,21,'Evito utilizar amenazas o demandas para imponer mi voluntad sobre los demás.',41),(147,22,'Empleo recursos e información que yo controlo para equilibrar las demandas y las amenazas.',42),(148,23,'Me niego a negociar con individuos que emplean tácticas de negociación basadas en la presión.',42),(149,24,'Explico por qué no puedo cumplir con solicitudes que suenan razonables al señalar cómo las consecuencias afectarían mis responsabilidades y obligaciones.',42),(150,25,'Ayudo a determinar los asuntos a los que ellos prestan atención al exponer en forma efectiva la importancia de éstos.',43),(151,26,'Los convenzo de que los asuntos sobre los que deseo enfocarme son compatibles con los objetivos y con el éxito futuro de la organización.',43),(152,27,'Les ayudo a resolver problemas que ellos n